from itertools import product
BOARD = set(map(''.join, product('ABCDEFGH', '12345678')))

def available_moves(position):
    if isinstance(position, str) or position in BOARD:
        moves = [p for p in BOARD - {position} if abs(ord(p[0]) - ord(position[0])) == abs(int(p[1]) - int(position[1])) or position[0] == p[0] or position[1] == p[1]]
        return sorted(moves)
    return []

